import yt from "./youtube.svg";
import apple from "./apple.svg";
import android from "./android.svg";

function Footer() {
    return (
        <>
            <footer className="footer">
                <h5>Copyright&#169; 2023 VedAssist | Unlock the power of Ayurveda</h5>
            </footer>
        </>
